INSERT INTO `actividades` VALUES (1,'Capacitaciones','2023-08-10 18:09:34','capacitaciones.png','Se asignarán puntos por la participación oportuna (En fecha y hora) en cada capacitación programada por el área de Talento Humano. Por cada capacitación se otorgarán 25 puntos. A los colaboradores que realicen las capacitaciones en fechas y horas diferentes a las programadas, se les otorgarán 10 puntos.',NULL,NULL),(2,'Pausas Activas','2023-08-10 18:09:34','pausasactivas.png','Se asignarán 5 puntos por cada pausa activa en la que participen los colaboradores (Tanto para colaboradores en oficina como teletrabajadores). Adicionalmente, se asignarán 25 puntos a quienes voluntariamente quieran dirigir una pausa activa. Para esto deberán coordinar previamente con Cesar Rodríguez y/o Lina Guio. ','pausas.png','En este código QR puedes registrar tu asistencia a la pausa activa'),(3,'Reportes de Actos y Condiciones Inseguras','2023-08-10 18:09:34','reportes.png','Reportes en oficina: Se asignarán 25 puntos por cada reporte de acto y/o condición insegura reportada Reportes teletrabajadores: Se asignarán 25 puntos por cada reporte de acto y/o condición insegura reportada  Adicionalmente, para los teletrabajadores, se asignarán 25 puntos adicionales por demostrar el cierre o tratamiento de dicho reporte. ','condiciones_inseguras.png','En este código QR puedes registrar tu reporte de actos y condiciones'),(4,'Participación en Comités de SSTA','2023-08-10 18:09:34','participacionssta.png','Se asignarán 25 puntos a los colaboradores que participen activamente en los comités de SSTA (COPASST, Brigada de emergencias y COCOLAB)Se tendrán en cuenta la asistencia a reuniones, ejecución de campañas preventivas, participación en inspecciones, etc. ',NULL,NULL),(5,'Inspecciones Comportamentales','2023-08-10 18:09:34','resultados.png','Se asignarán 50 puntos a los colaboradores que obtengan resultados positivos en términos generales en las inspecciones comportamentales y/o de puesto de trabajo que son realizadas en oficina y a los teletrabajadores. Esta inspección será realizada por el responsable de SSTA en conjunto con el colaborador. Para quienes tengan aspectos relevantes por mejorar, podrán sumar 40 puntos una vez que demuestren la gestión de los hallazgos evidenciados. ',NULL,NULL),(6,'Tapitas Para Sanar','2023-08-10 18:09:34','tapitas.png','Por cada tapita que se deposite en la oficina, se asignará un punto. Para esto, los colaboradores deben escanear el código QR Los teletrabajadores podrán acumular sus tapas en casa y enviarlas a la oficina cuando tengan una cantidad considerable. Solicitamos que por favor coordinen el envío con Cesar Rodríguez y/o Lina Guio. La puntuación máxima a obtener por tapas es de 200 puntos (Equivalentes a 200 tapas). ',NULL,NULL),(7,'Participación en Actividades Ambientales','2023-08-10 18:09:34','participacionambiental.png','Los colaboradores que demuestren su participación en actividades ambientales (Caminatas ecológicas, siembra de árboles, separación de residuos en casa, uso eficiente de recursos naturales, etc.), podrán obtener 50 puntos.  Deberán remitir el registro fotográfico (Con fecha y hora) al área de SSTA (Cesar Rodríguez y/o Lina Guio) No se admitirán registros fotográficos de actividades realizadas antes del periodo a premiar. En el semestre máximo se premiarán 5 actividades ambientales (Por colaborador) Máximo puntaje a obtener: 250 ',NULL,NULL),(8,'Hábitos y Estilos de Vida Saludable','2023-08-10 18:09:34','habitos.png','Los colaboradores que demuestren su participación en actividades que fomenten hábitos y estilos de vida saludable podrán obtener 50 puntos Ejemplo:  Asesoría con nutricionista,  Ejercicio / Gimnasio (No serán tenidas en cuenta  las pausas activas en 	este ítem), YogaMeditación, etc.  Deberán remitir el registro fotográfico (con fecha y hora) al área de SSTA (Cesar Rodríguez y/o Lina Guio)No se admitirán registros fotográficos de actividades realizadas antes del periodo a premiar. En el semestre máximo se premiarán 5 actividades de hábitos y estilos de vida saludable (Por colaborador) Máximo puntaje a obtener: 250  ',NULL,NULL),(9,'Uso de Medio de Transporte Ambientales','2023-08-10 18:09:34','transporte.png','Los colaboradores que demuestren el uso de medios de transporte ambientalmente sostenibles se les asignarán 2 puntos (1 punto por cada trayecto) Deberán registrar su información en el código QR diariamente o según uso del medio de transporte.  En el caso de los teletrabajadores, se premiarán los usos que realicen para sus diligencias personales. Deben enviar registro fotográfico (Con fecha y hora) a Cesar Rodríguez y/o Lina Guio Ejemplos de medios de transporte ambientalmente sostenibles:  Bicicletas Patines Vehículos eléctricos Caminar. Carro y/o moto compartidos. Los puntos máximos a obtener por este ítem es de 240',NULL,NULL),(10,'Cumplimiento en los Tiempos de Respuesta','2023-08-10 18:09:34','cumplimiento.png','Cada colaborador tendrá una cantidad definida de evaluaciones de desempeño por realizar. Se otorgarán 25 puntos a los colaboradores que finalicen sus procesos de evaluación en un tiempo inferior o igual al límite definido por la organización (3 días máximo) ',NULL,NULL),(11,'Otras Actividades','2023-08-10 18:09:34','otros.png','Actividades extras que el colaborador realice',NULL,NULL),(12,'Ciberseguridad','2023-08-10 18:09:34','ciberseguridad.png','Ciberseguridad',NULL,NULL);
